import React from 'react';

const Sresult = (props) => {
    const img = `https://source.unsplash.com/user/erondu/400x300/?`;
    return (
        <>
        <div>
            <img src={img} alt="Search" />
        </div>
        </>
    )
}
export default Sresult;
